import React from 'react'
import './homepage.css';
import adminImage from "../../Images/deepak.png"
import About from './about';
import Resume from '../../resume/Deepak_Kumar_resume.pdf'
import ProgressBar from '../progressbar/progressbar';
function Homepage() {

    function onloadfunction(){
    // if (document.getElementById("main-Box-of-Website")){
        document.getElementById("main-Box-of-Website").addEventListener("scroll",()=>{
            if (Number((document.getElementById("myBar").getBoundingClientRect()).bottom) < 655){
                var i = 0;
                progressbarWidth(30,i)
            }
        })
    // }
    }

    function progressbarWidth(progressvalue,i){
        if (i === 0) {
          i = 1;
          var elem = document.getElementById("myBar");
          var width = 1;
          var id = setInterval(frame, 10);
          function frame() {
            if (width >= progressvalue) {
              clearInterval(id);
              i = 0;
            } else {
              width++;
              elem.style.width = width + "%";
            }
          }
        }
    }

    return (
        <div className="homepage-container-Wrapper" onLoad={onloadfunction}>
            <div className="navbar-side-Wrapper"></div>
            <div className="Wrapper-Box-content-Hompage">
                <div className="main-Box-of-Website" id="main-Box-of-Website">
                    <div className="intro-Div-Wrapper">
                        <div className="intro-Div-Wrapper-Details">
                            <div className="name-div">
                                <p className="website-para1">Hi, I'm</p>
                                <p className="website-para2">Deepak <span>Kumar</span></p>
                            </div>
                            <div className="horizontal-Line-homepage"></div>
                            <div className="expertise-in-div"> IT Expert <span>Full Stack Developer</span></div>
                        </div>
                        <div className="intro-Div-Wrapper-photo">
                            <img src={adminImage} alt="Deepak Kumar Data Not Found" className="admin-Image" />
                        </div>
                    </div>
                    <div className="buttons-Wrapper">
                        <button className="download-Resume-Button" 
                        // onClick={downloadResumeButton} 
                        // downlaod 
                        > <a href={Resume} download="Deepak-Kumar-Resume" >downlaod resume</a></button>
                        <button className="view-Portfolio-Button">view portfolio</button>
                    </div>

<About/>
<div id="myProgress" >
    <div id="myBar"></div>
</div>
{/* <ProgressBar progressvalue='30' /> */}
<ProgressBar progressvalue='70' />

                </div>
            </div>
        </div>
    )
}

export default Homepage;
